// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;  
contract airport{
    function getSum(uint256[] calldata arr) public pure returns(uint256 sum){
        for(uint i=0;i<arr.length;i++)
            sum = sum+arr[i];
    }

    
}

